    const dragOver = event => {
        event.preventDefault();
    }

    const numbers = []
    for(let i=0;i<10;i++) {
        numbers.push(<Symbol>{i}</Symbol>)
    }

    return (

        <div 
            className='calculator'
        >
            <div className='numbers'>
                {numbers}
